pathCostPerPartition = []

# Used to solve partitioned clusters
def euclidean(a, b):
    return ((a[0] - b[0])**2 + (a[1] - b[1])**2)**0.5

def total_path_distance(path):
    return sum(euclidean(path[i], path[i+1]) for i in range(len(path) - 1))

def solve_unravel(nodes):
    start = nodes[0]
    unvisited = nodes[1:]
    path = [start]
    current = start

    while unvisited:
        next_node = min(unvisited, key=lambda x: euclidean(current, x))
        path.append(next_node)
        unvisited.remove(next_node)
        current = next_node

    improved = True
    while improved:
        improved = False
        for i in range(1, len(path) - 2):
            for j in range(i + 1, len(path)):
                if j - i == 1:
                    continue
                new_path = path[:i] + path[i:j][::-1] + path[j:]
                if total_path_distance(new_path) < total_path_distance(path):
                    path = new_path
                    improved = True

    return total_path_distance(path), path[0], path[-1]

def clusters(nodes, clusterSize):
    unvisited = nodes.copy()
    clusters=[]

    while len(unvisited) >= clusterSize:
        cluster = []
        start_node = random.choice(unvisited)
        cluster.append(start_node)
        unvisited.remove(start_node)

        while len(cluster) < clusterSize:
            last = cluster[-1]
            testNextNode = None
            testDistance = float("inf")

            for i in unvisited:
                if euclidean(last, i) < testDistance:
                    testNextNode = i
                    testDistance = euclidean(last, i)
            cluster.append(testNextNode)
            unvisited.remove(testNextNode)
        
        clusters.append(cluster)
    
    return clusters

def cluster_connection(clusters):
    num_clusters = len(clusters)
    connections = {}

    for i in range(num_clusters):
        for j in range(num_clusters):
            if i == j:
                continue

            cluster_a = clusters[i]
            cluster_b = clusters[j]

            min_cost = float('inf')
            min_pair = (None, None)

            for node_a in cluster_a:
                for node_b in cluster_b:
                    dist = euclidean(node_a, node_b)
                    if dist < min_cost:
                        min_cost = dist
                        min_pair = (node_a, node_b)

            connections[(i, j)] = {
                "cost": min_cost,
                "from": min_pair[0],
                "to": min_pair[1]
            }

    return connections

def inter_cluster_cost(order):
    cost = 0
    for i in order:
        cost += pathCostPerPartition[i][0]
    for i in range(len(order) - 1):
        a, b = order[i], order[i + 1]
        cost += cluster_connections[(a, b)]["cost"]
    return cost

def calculate_totalCost(pathCostPerPartition, cluster_connections):
    num_clusters = len(pathCostPerPartition)
    cluster_indexes = []
    for i in range(num_clusters):
        cluster_indexes.append(i)

    best_order = cluster_indexes[:]
    min_total_cost = float("inf")
    improved = True

    while improved:
        improved = False
        for i in range(1, num_clusters - 2):
            for j in range(i + 1, num_clusters):
                if j - i == 1:
                    continue
                new_order = best_order[:i] + best_order[i:j][::-1] + best_order[j:]
                new_cost = inter_cluster_cost(new_order)
                if new_cost < min_total_cost:
                    best_order = new_order
                    min_total_cost = new_cost
                    improved = True

    print("Best cluster order:", best_order)
    return min_total_cost


clusters = clusters(nodes, 10)
for i in clusters:
    pathCostPerPartition.append(solve_unravel(i))

cluster_connections = cluster_connection(clusters)
print(cluster_connections)
print(calculate_totalCost(pathCostPerPartition, cluster_connections))
